import React, {Profiler} from 'react';
import Directory from '../../components/directory/index';
import { HomePageContainer } from './index.styles';


const HomePage = () => {
    return (
        <HomePageContainer >
            <Profiler>
            <Directory />
            </Profiler>
        </HomePageContainer>
    )
}

export default HomePage;
